// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract BountyContract {
    enum BountyStatus { Open, InProgress, Completed, Cancelled }

    struct Bounty {
        uint256 id;
        address employer;
        string title;
        string description;
        uint256 reward;
        string rewardToken;  // Token symbol (e.g., "ETH", "USDT")
        uint256 deadline;  // Unix timestamp
        BountyStatus status;
        address assignee;  // Address of the person assigned to the task
        uint256 createdAt;
        bool exists;
    }

    // Bounty counter
    uint256 private bountyCounter;

    // Mapping from bounty ID to bounty data
    mapping(uint256 => Bounty) private bounties;

    // Mapping from user address to their bounties (as employer)
    mapping(address => uint256[]) private employerBounties;

    // Mapping from user address to their assigned bounties (as worker)
    mapping(address => uint256[]) private assigneeBounties;

    // Events
    event BountyCreated(uint256 indexed id, address indexed employer, string title, uint256 reward, string rewardToken, uint256 deadline);
    event BountyAssigned(uint256 indexed id, address indexed assignee);
    event BountyCompleted(uint256 indexed id);
    event BountyCancelled(uint256 indexed id);

    /**
     * @dev Create a new bounty
     * @param _title Title of the bounty
     * @param _description Description of the bounty
     * @param _reward Reward amount
     * @param _rewardToken Token symbol
     * @param _deadline Deadline timestamp
     * @return Bounty ID
     */
    function createBounty(
        string memory _title,
        string memory _description,
        uint256 _reward,
        string memory _rewardToken,
        uint256 _deadline
    ) public returns (uint256) {
        require(bytes(_title).length > 0, "Title cannot be empty");
        require(bytes(_description).length > 0, "Description cannot be empty");
        require(_reward > 0, "Reward must be greater than 0");
        require(_deadline > block.timestamp, "Deadline must be in the future");

        bountyCounter++;
        uint256 bountyId = bountyCounter;

        Bounty memory newBounty = Bounty({
            id: bountyId,
            employer: msg.sender,
            title: _title,
            description: _description,
            reward: _reward,
            rewardToken: _rewardToken,
            deadline: _deadline,
            status: BountyStatus.Open,
            assignee: address(0),
            createdAt: block.timestamp,
            exists: true
        });

        bounties[bountyId] = newBounty;
        employerBounties[msg.sender].push(bountyId);

        emit BountyCreated(bountyId, msg.sender, _title, _reward, _rewardToken, _deadline);

        return bountyId;
    }

    /**
     * @dev Apply for a bounty
     * @param _bountyId ID of the bounty
     */
    function applyForBounty(uint256 _bountyId) public {
        Bounty storage bounty = bounties[_bountyId];

        require(bounty.exists, "Bounty does not exist");
        require(bounty.status == BountyStatus.Open, "Bounty is not open");
        require(bounty.employer != msg.sender, "Employer cannot apply for own bounty");
        require(block.timestamp < bounty.deadline, "Bounty deadline has passed");

        // In a real implementation, this would involve more logic,
        // such as storing applications and letting the employer choose
        // For simplicity, we're auto-assigning the first applicant
        bounty.assignee = msg.sender;
        bounty.status = BountyStatus.InProgress;
        assigneeBounties[msg.sender].push(_bountyId);

        emit BountyAssigned(_bountyId, msg.sender);
    }

    /**
     * @dev Complete a bounty (only callable by employer)
     * @param _bountyId ID of the bounty
     */
    function completeBounty(uint256 _bountyId) public {
        Bounty storage bounty = bounties[_bountyId];

        require(bounty.exists, "Bounty does not exist");
        require(bounty.employer == msg.sender, "Only employer can complete bounty");
        require(bounty.status == BountyStatus.InProgress, "Bounty must be in progress");

        bounty.status = BountyStatus.Completed;

        emit BountyCompleted(_bountyId);

        // In a real implementation, this would involve transferring tokens
        // to the assignee as payment for completing the bounty
    }

    /**
     * @dev Cancel a bounty (only callable by employer)
     * @param _bountyId ID of the bounty
     */
    function cancelBounty(uint256 _bountyId) public {
        Bounty storage bounty = bounties[_bountyId];

        require(bounty.exists, "Bounty does not exist");
        require(bounty.employer == msg.sender, "Only employer can cancel bounty");
        require(bounty.status == BountyStatus.Open, "Can only cancel open bounties");

        bounty.status = BountyStatus.Cancelled;

        emit BountyCancelled(_bountyId);
    }

    /**
     * @dev Get a bounty by ID
     * @param _bountyId ID of the bounty
     * @return id Bounty ID
     * @return employer Employer address
     * @return title Bounty title
     * @return description Bounty description
     * @return reward Reward amount
     * @return rewardToken Reward token symbol
     * @return deadline Deadline timestamp
     * @return status Bounty status
     * @return assignee Assignee address
     * @return createdAt Creation timestamp
     * @return exists Whether the bounty exists
     */
    function getBounty(uint256 _bountyId) public view returns (
        uint256 id,
        address employer,
        string memory title,
        string memory description,
        uint256 reward,
        string memory rewardToken,
        uint256 deadline,
        BountyStatus status,
        address assignee,
        uint256 createdAt,
        bool exists
    ) {
        Bounty memory bounty = bounties[_bountyId];
        require(bounty.exists, "Bounty does not exist");

        return (
            bounty.id,
            bounty.employer,
            bounty.title,
            bounty.description,
            bounty.reward,
            bounty.rewardToken,
            bounty.deadline,
            bounty.status,
            bounty.assignee,
            bounty.createdAt,
            bounty.exists
        );
    }

    /**
     * @dev Get all bounties created by an employer
     * @param _employer Address of the employer
     * @return Array of bounty IDs
     */
    function getEmployerBounties(address _employer) public view returns (uint256[] memory) {
        return employerBounties[_employer];
    }

    /**
     * @dev Get all bounties assigned to a worker
     * @param _assignee Address of the assignee
     * @return Array of bounty IDs
     */
    function getAssigneeBounties(address _assignee) public view returns (uint256[] memory) {
        return assigneeBounties[_assignee];
    }

    /**
     * @dev Get the total number of bounties
     * @return Total number of bounties
     */
    function getBountyCount() public view returns (uint256) {
        return bountyCounter;
    }
}

