// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

/**
 * @title BountyContract
 * @dev Manages bounty tasks and rewards for the Web3Hire platform
 */
contract BountyContract {
    struct Task {
        address employer;
        uint256 reward;
        address winner;
        bool completed;
        string taskId; // Reference to off-chain task ID
        uint256 createdAt;
    }

    mapping(uint256 => Task) public tasks;
    uint256 public taskCount;

    event TaskCreated(uint256 indexed taskId, address indexed employer, uint256 reward, string offChainTaskId);
    event TaskCompleted(uint256 indexed taskId, address indexed winner, uint256 reward);
    event TaskCancelled(uint256 indexed taskId, address indexed employer, uint256 reward);

    /**
     * @dev Create a new task with a reward
     * @param offChainTaskId Reference to the task in the database
     */
    function createTask(string memory offChainTaskId) external payable {
        require(msg.value > 0, "Reward must be greater than 0");

        tasks[taskCount] = Task({
            employer: msg.sender,
            reward: msg.value,
            winner: address(0),
            completed: false,
            taskId: offChainTaskId,
            createdAt: block.timestamp
        });

        emit TaskCreated(taskCount, msg.sender, msg.value, offChainTaskId);
        taskCount++;
    }

    /**
     * @dev Complete a task and transfer reward to winner
     * @param taskId ID of the task
     * @param winner Address of the winner
     */
    function completeTask(uint256 taskId, address winner) external {
        Task storage task = tasks[taskId];
        require(msg.sender == task.employer, "Only employer can complete the task");
        require(!task.completed, "Task already completed");
        require(winner != address(0), "Invalid winner address");

        task.winner = winner;
        task.completed = true;

        (bool success, ) = payable(winner).call{value: task.reward}("");
        require(success, "Transfer failed");

        emit TaskCompleted(taskId, winner, task.reward);
    }

    /**
     * @dev Cancel a task and refund the reward to the employer
     * @param taskId ID of the task
     */
    function cancelTask(uint256 taskId) external {
        Task storage task = tasks[taskId];
        require(msg.sender == task.employer, "Only employer can cancel the task");
        require(!task.completed, "Task already completed");

        uint256 refundAmount = task.reward;
        task.reward = 0;
        task.completed = true;

        (bool success, ) = payable(task.employer).call{value: refundAmount}("");
        require(success, "Refund failed");

        emit TaskCancelled(taskId, task.employer, refundAmount);
    }

    /**
     * @dev Get task details
     * @param taskId ID of the task
     * @return Task details
     */
    function getTask(uint256 taskId) external view returns (Task memory) {
        require(taskId < taskCount, "Task does not exist");
        return tasks[taskId];
    }
}

