// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

/**
 * @title ResumeContract
 * @dev Stores and retrieves resume IPFS hashes for users
 */
contract ResumeContract {
    mapping(address => string) public resumes; // wallet address -> IPFS hash
    mapping(address => bool) public hasResume; // track if user has uploaded a resume

    event ResumeUploaded(address indexed user, string ipfsHash);
    event ResumeUpdated(address indexed user, string oldIpfsHash, string newIpfsHash);

    /**
     * @dev Upload a new resume or update existing one
     * @param ipfsHash IPFS hash of the resume
     */
    function uploadResume(string memory ipfsHash) external {
        require(bytes(ipfsHash).length > 0, "Invalid IPFS hash");

        if (hasResume[msg.sender]) {
            // Update existing resume
            string memory oldHash = resumes[msg.sender];
            resumes[msg.sender] = ipfsHash;
            emit ResumeUpdated(msg.sender, oldHash, ipfsHash);
        } else {
            // Upload new resume
            resumes[msg.sender] = ipfsHash;
            hasResume[msg.sender] = true;
            emit ResumeUploaded(msg.sender, ipfsHash);
        }
    }

    /**
     * @dev Get resume IPFS hash for a specific user
     * @param user Address of the user
     * @return Resume IPFS hash
     */
    function getResume(address user) external view returns (string memory) {
        require(hasResume[user], "User has no resume");
        return resumes[user];
    }

    /**
     * @dev Check if a user has uploaded a resume
     * @param user Address of the user
     * @return Boolean indicating if user has a resume
     */
    function userHasResume(address user) external view returns (bool) {
        return hasResume[user];
    }
}

