// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract ResumeContract {
    struct Resume {
        string ipfsHash;  // IPFS hash of the resume file
        uint256 timestamp;  // When the resume was uploaded
        string fileName;  // Original file name
        bool exists;  // To check if a resume exists
    }

    // Mapping from user address to their resume
    mapping(address => Resume) private resumes;

    // Events
    event ResumeUploaded(address indexed user, string ipfsHash, uint256 timestamp, string fileName);

    /**
     * @dev Upload or update a resume
     * @param _ipfsHash IPFS hash of the resume file
     * @param _fileName Original file name
     */
    function uploadResume(string memory _ipfsHash, string memory _fileName) public {
        require(bytes(_ipfsHash).length > 0, "IPFS hash cannot be empty");
        require(bytes(_fileName).length > 0, "File name cannot be empty");

        resumes[msg.sender] = Resume({
            ipfsHash: _ipfsHash,
            timestamp: block.timestamp,
            fileName: _fileName,
            exists: true
        });

        emit ResumeUploaded(msg.sender, _ipfsHash, block.timestamp, _fileName);
    }

    /**
     * @dev Get a user's resume
     * @param _user Address of the user
     * @return Resume data (ipfsHash, timestamp, fileName)
     */
    function getResume(address _user) public view returns (string memory, uint256, string memory, bool) {
        Resume memory resume = resumes[_user];
        return (resume.ipfsHash, resume.timestamp, resume.fileName, resume.exists);
    }

    /**
     * @dev Check if a user has a resume
     * @param _user Address of the user
     * @return True if the user has a resume, false otherwise
     */
    function hasResume(address _user) public view returns (bool) {
        return resumes[_user].exists;
    }
}

